    "userdoc": {
        "methods": {
            "addAuthorizedCollateralizeAgent(address)": {
                "notice": "Adds an address to the list of agents authorized to invoke the `collateralize` function."
            },
            "collateralize(bytes32,address)": {
                "notice": "Transfers collateral from the debtor to the current contract, as custodian."
            },
            "getAuthorizedCollateralizeAgents()": {
                "notice": "Returns the list of agents authorized to invoke the 'collateralize' function."
            },
            "retrieveCollateralParameters(bytes32)": {
                "notice": "Unpacks the terms contract parameters, and uses those parameters to retrieve specific values that are pertinent to this collateralizer contract -- such as the address of the collateral token and the token's ID, which are not encoded in the terms contract parameters."
            },
            "returnCollateral(bytes32)": {
                "notice": "Returns collateral to the debt agreement's debtor if and only if the debt agreement's term has lapsed and the total expected repayment value has been repaid."
            },
            "revokeCollateralizeAuthorization(address)": {
                "notice": "Removes an address from the list of agents authorized to invoke the `collateralize` function."
            },
            "seizeCollateral(bytes32)": {
                "notice": "Seizes the collateral from the given debt agreement and transfers it to the debt agreement's current beneficiary (i.e. the person who \"owns\" the debt)."
            },
            "unpackCollateralParametersFromBytes(bytes32)": {
                "notice": "Unpacks collateralization-specific parameters from their tightly-packed representation in a terms contract parameter string."
            }
        }
    }
